  [],\n\t\"revision_timestamp\": \"2013-03-15T11:00:17.161538\",\n\t\"name\": \"cedar-breaks-national-monument-vegetation-mapping-project-field-plot-observation-points-and-ac\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This point file contains 282 point locations
  of field plot and observation data used by, and collected for, the vegetation mapping
  project for Cedar Breaks National Monument. Plots and observation points were located
  subjectively in representative vegetation throughout the park. Field crews decided
  where and when to use observation points or vegetation plots to sample the vegetation.
  Vegetation plots (172) were placed in stands judged by field crews to represent
  legitimate vegetation types that could be classified to the National Vegetation
  Classification (NVC) system using standard multivariate analysis techniques. Observation
  points (110) were placed in stands (1) if the vegetation was highly altered and
  therefore not classifiable, (2) to provide information about the distribution of
  common vegetation types adequately sampled in vegetation plots, or (3) if the stand
  represented a unique vegetation type that was too small to hold a 400m2 sample plot
  (e.g., seeps, hanging gardens). Plot and observation locations were collected in
  the summer of 2006 and were GPSed (primarily using recreational grade GPS units).
  Field photos are associated with each plot. This point file displays the 303 accuracy
  assessment (AA) points visited in August and September of 2007 as part of the vegetation
  mapping project. The points were randomly selected, stratified by the map units
  used for vegetation mapping and further screened so as not to fall in inaccessible
  areas or vertical canyon walls. The coordinates were uploaded to Trimble hand-held
  GPS receivers so that ecologists could navigate to them in the field and the locations
  where data were collected were updated. Some AA points fell on ecotones and two
  sets of data were recorded on the evenly-split sites. AA points that fell along
  polygon edges sometimes did not represent the entire polygon well and some AA points
  fell on small patches of vegetation that were different than the community in the
  larger polygon. Field photos are associated with each plot. Only points within the
  NPS boundary were visited; the accuracy of the vegetation map outside the park boundary
  is untested.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"temporal-extent-begin\",\n\t\t\"value\":
